function getTabs() {
  return presidents.map((president, index) => ({
    title: president.name,
    getContent: () => president.biography,
    /* Optional parameters */
    key: index,
    tabClassName: 'tab',
    panelClassName: 'panel',
  }));
}


const Notifications = function () {
  return (
    <div>
        <Tabs items={getTabs()} />
    </div>
  )
}

